import React from 'react';

export default class Todoform extends React.Component {
	render() {
		return (
			<React.Fragment>
				<input 
            		value={this.props.inputValue}
            		onChange={e => this.props.onChangeInput(e)} />

          		<button onClick={e => this.props.onClick(e)}>Salvar</button>

			</React.Fragment>
		);
	}
}
